// commitDataThunks.js
import { fetchCommitDataStart} from'../reducer/chartdataSlice'
import axios from 'axios';
export const fetchCommitData = (owner, repo) => async (dispatch) => {
  try {
    dispatch(fetchCommitDataStart());

    // Replace 'https://api.example.com/commit-data' with your actual API endpoint
    const response = await axios.get(`https://api.example.com/commit-data/${owner}/${repo}`);
    const data = response.data;

    dispatch(fetchCommitDataSuccess(data));
  } catch (error) {
    dispatch(fetchCommitDataFailure(error.message));
  }
};
